import React, { Component } from 'react'
import {Card,List} from 'antd'
import LinkButton from '../../Link-Button'

const Item =List.Item
export default class Detail extends Component {
    render() {
        const title=(
            <span>
                <LinkButton>←</LinkButton>&nbsp;&nbsp;
                <span>商品详情</span>
            </span>
        )
        return (
            <Card title={title}>

            </Card>
        )
    }
}
